import React from 'react'

const cameraLayout = () => {

    let cameraFlexLayout = {
        dispay: 'flex',
        overflow: 'scroll'
    }

    let videoStyle = {
        width: '20%',
        height: '20%'
    }

    return(
    <div>
        <h1>Camera Layout</h1>
        <div className = {cameraFlexLayout}>
            <video src="../../assetts/testVids/carsTest.mp4" className = {videoStyle}></video>
        </div>
    </div>
    )
}

export default cameraLayout
